// Libraries
import React from 'react'

// Children
import Merchandise from './merchandise'

class Merchandises extends React.Component {
  constructor (props) {
    super(props)
    this.data = {}
    this.state = Object.assign({}, this.data)
  }

  validate () {
    return this.refs['merchandise'].validate()
  }

  export () {
    const merchandise = this.refs['merchandise'].export()
    return [merchandise]
  }

  render () {
    return <Merchandise ref='merchandise' />
  }
}

export default Merchandises
